import React from 'react';

const BlockInfo = (props) =>{

    const block_data = props.information;

    console.log(block_data);

    return(
        <div className="container">
            <div className="row">
                <div className="col-sm-7">{props.information.id}</div>
                <div className="col-sm-3">{props.information.timestamp}</div>
                <div className="col-sm-2">{props.information.transactions}</div>
            </div>
        </div>
    )
}

export default BlockInfo;
